const title = {
  title: 'My Main Title',
  subtitle: 'My Sub Title',
  list: [
    'list Item 1',
    'list Itme 2'
  ]
}
let list = "";

for(let l of title.list){
  list += '<li>' + {l} +'</li>';
}



console.log(list);

 function App() {
  return (
    <div>
      <h1>{title.title}</h1>
      <p>{title.subtitle}</p>
      <ol>
        {list}
      </ol>
    </div>
  );
}

